import React from "react";

const Landing = () => {
  return (
    <div>
      <nav>
        <a href="#">HomeL</a>
        <a href="#">Watch Content</a>
        <a href="#">Upload Content</a>
        <a href="#">Sign Up</a>
      </nav>
      <h1> This is the landing page </h1>
    </div>
  );
};

export default Landing;
